class Solution {

    /**
     * @param Integer[] $nums
     * @return Boolean
     */
    function hasTrailingZeros($nums) {
        // Initialize an array to keep track of which bits are set across all numbers.
        $bits = array_fill(0, 32, 0);

        // Populate the $bits array by setting bits[index] to 1 if any number has that bit set.
        foreach ($nums as $num) {
            for ($i = 0; $i < 32; $i++) {
                if ($num & (1 << $i)) {
                    $bits[$i]++;
                }
            }
        }

        // Check if there's any bit position where more than one number has that bit set.
        // This would imply that selecting these numbers could result in a bitwise OR with at least one trailing zero.
        foreach ($bits as $count) {
            // If any bit is found in more than one number, it's possible to have a trailing zero.
            if ($count > 1) {
                return true;
            }
        }

        // If no such bits are found, it's not possible to achieve a trailing zero with any combination.
        return false;
    }
}
